import React from 'react';

export const Product = (props) => {
    const {id, productName, productDesc, price, productImage} = props.data;
    return (
        <div className="product">
            <img src={productImage} />
            <div className="description">
                <p>
                    <b>{productName}</b>
                </p>
                <p>{productDesc}</p>
                <p>${price}</p>
            </div>
        </div>
    );
};
